//                  CONTACT PAGE AS A COMPONENT                   \\

// Importing Modules :
import React from 'react';

import { Name, ID } from "./App"

const Contact = (props) => {
    return (
        <Name.Consumer>
            {
                (namedata) => {
                    return (
                        <ID.Consumer>
                            {
                                (iddata) => {
                                    return (
                                        <>
                                            This is CONTACT-US Pageasdasd {props.name} {props.id}.
                                    My name is {namedata} {iddata} 
                                        </>
                                    )
                                }
                            }
                        </ID.Consumer>
                    )
                }
            }
        </Name.Consumer>
    )
}

// Exporting Contact COmponent :
export default Contact;
